import React from 'react'
import s from './ProductCard.module.css'

export default function ProductCard({title, price, description, image}) {

  return (
    <div className={s.card}>
      <img src={image} alt='img' className={s.products_card_img} />
      <h6 className={s.card_title}>{title}</h6>
      <div className={s.card_price}>{price}</div>
      <div className={s.card_description}>{description}</div>
    </div>
  )
}
